import React from 'react';

const Incidents = () => {
  return (
    <div>
      <h1 className="text-2xl font-bold text-gray-900 mb-6">
        Incidentes
      </h1>
      <div className="card">
        <p className="text-gray-600">
          Lista de incidentes - En desarrollo
        </p>
      </div>
    </div>
  );
};

export default Incidents;
